  const { favored, setfavored } = useContext(CustomContext);
  const likeProductsList = JSON.parse(localStorage.getItem("likes"));
  console.log(likeProductsList);
  return (
    <div>
      <h1>asd</h1>
      {likeProductsList.map((item) => {
        <span>{item.name}</span>;
      })}
    </div>
  );
}

export default Like;
